import { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import { AdapterDateFns } from "@mui/x-date-pickers/AdapterDateFns";

import { DateTimePicker } from "@mui/x-date-pickers/DateTimePicker";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import TextField from "@mui/material/TextField";
import MenuItem from "@mui/material/MenuItem";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Select from "@mui/material/Select";
import Box from "@mui/material/Box";

const baseURL = `http://54.215.188.103:9090/api/v1`;

function App() {
  const [metrics, setMetrics] = useState<string[]>([]);
  const [selectedMetric, setSelectedMetric] = useState<string | null>("");
  const [stDate, setStDate] = useState<Date>(new Date());
  const [endDate, setEndDate] = useState<Date>(new Date());
  const [step, setStep] = useState<number>(100);

  const [tsData, setTsData] = useState<string>();

  useEffect(() => {
    (async () => {
      const { data } = await axios.get(`${baseURL}/label/__name__/values`);
      setMetrics(data.data);
    })();
  }, []);

  const jsonArrToCsv = (jsonArr: {}[]): string => {
    let outStr = "";
    for (let i = 0; i < jsonArr.length; i++) {
      if (i === 0) {
        outStr += Object.keys(jsonArr[i]).join(",");
        outStr += "\n";
        continue;
      }
      outStr += Object.values(jsonArr[i]).join(",");
      outStr += "\n";
    }
    return outStr;
  };

  const downloadHandler = async () => {
    const { data } = await axios.get(
      `${baseURL}/query_range?query=${selectedMetric}&start=${Math.floor(
        new Date(stDate).getTime() / 1000
      )}&end=${Math.floor(new Date(endDate).getTime() / 1000)}&step=${step}`
    );

    if (!data) {
      return;
    }
    console.log(data);

    const sanitizedData = data.data.result
      .map((res: any) => {
        return res.values.map(([ts, data]: any) => {
          const [customer_id, site_id, block_id, rack_manger_id] =
            res.metric.topic.split("-");
          return {
            timestamp: new Date(ts * 1000).toISOString(),
            value: data,
            topic: res.metric.topic,
            sensor_id: res.metric.sensor_id,
            host: res.metric.instance,
            customer_id,
            site_id,
            block_id,
            rack_manger_id,
          };
        });
      })
      .flat();
    const csvOut = jsonArrToCsv(sanitizedData);
    setTsData(csvOut);
    const outBlob = new Blob([csvOut], { type: "text/csv;charset=utf-8" });
    const url = URL.createObjectURL(outBlob);
    const link = document.createElement("a");
    link.href = url;
    link.click();
  };

  return (
    <>
      <LocalizationProvider dateAdapter={AdapterDateFns}>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <AppBar position="static">
              <Toolbar>
                <Box
                  component="img"
                  src="data:image/png;base64,"
                  maxWidth="150px"
                ></Box>
                <Typography variant="h6" component="div" sx={{ mx: "2rem" }}>
                  Promethues Data Dump
                </Typography>
              </Toolbar>
            </AppBar>
          </Grid>
          <Grid
            item
            xs={12}
            container
            justifyContent="center"
            alignItems="center"
          >
            <Paper sx={{ padding: "1rem" }}>
              <Grid
                item
                xs={12}
                container
                spacing={2}
                justifyContent="flex-start"
              >
                <Grid item xs={12}>
                  <TextField
                    select
                    fullWidth
                    label="metric"
                    color="primary"
                    value={selectedMetric}
                    onChange={(e) => setSelectedMetric(e.target.value)}
                  >
                    {metrics.map((x) => (
                      <MenuItem value={x}>{x}</MenuItem>
                    ))}
                  </TextField>
                </Grid>

                <Grid
                  item
                  xs={12}
                  container
                  columnSpacing={2}
                  justifyContent="flex-start"
                  alignItems="center"
                >
                  <Grid item xs={12} md={6}>
                    <DateTimePicker
                      label="Start Date"
                      value={stDate}
                      renderInput={(params) => (
                        <TextField fullWidth {...params} />
                      )}
                      onChange={(e) => {
                        setStDate(e || new Date());
                      }}
                    />
                  </Grid>

                  <Grid item xs={12} md={6}>
                    <DateTimePicker
                      label="End Date"
                      value={endDate}
                      renderInput={(params) => (
                        <TextField fullWidth {...params} />
                      )}
                      onChange={(e: Date | null) => {
                        setEndDate(e || new Date());
                      }}
                    />
                  </Grid>
                </Grid>

                <Grid item xs={12} md={6}>
                  <TextField
                    fullWidth
                    id="step"
                    label="Step"
                    variant="outlined"
                    type="number"
                    onChange={(e) => {
                      setStep(parseInt(e.target.value));
                    }}
                  />
                </Grid>

                <Grid item xs={12}>
                  <Button onClick={downloadHandler} variant="outlined">
                    Submit
                  </Button>
                </Grid>

                <Grid item xs={12}>
                  <Typography variant="h6">Preview (10 lines)</Typography>
                  <pre>{tsData?.split("\n").slice(0, 10).join("\n")}</pre>
                </Grid>
              </Grid>
            </Paper>
          </Grid>
        </Grid>
      </LocalizationProvider>
    </>
  );
}

export default App;
